import React from "react";
import "./Sidebar.css";

const Sidebar = ({ functionalities, onFunctionalityClick }) => {
  return (
    <div className="sidebar">
      <h3><br/><br/><br/>Dashboard</h3>
      <ul>
        {functionalities.map((func, index) => (
          <li key={index} onClick={() => onFunctionalityClick(func)}>
            <button className="sidebar-btn">{func}</button>
            
          </li>
        ))}
        <button className="logout-btn"><a href="/">Logout</a></button>
      </ul>
      
    </div>
  );
};

export default Sidebar;
